"use strict";

import React from "react";
import {NavLink} from "react-router-dom";

function Main() {
    return (
        <main className="main">
            <div className="w-11/12 bg-white p-8 mx-auto mt-24 rounded-3xl text-center">
                <h4>Вход в личный кабинет</h4>
                <form className="flex flex-col" action="#">
                    <label form="login">Логин</label> <input id="login" type="text" placeholder="Введите логин"/>
                    <label form="password">Пароль</label> <input id="password" type="password" placeholder="Введите пароль"/>
                    <button className="uppercase" type="submit">Войти</button>
                </form>
                <NavLink to="/registration">Регистрация</NavLink>
            </div>
        </main>
    )
}

export default Main;
